    <KTCard>
      <div className="page">
        <div className="container-fluid">
          <div className="row mb-7 mt-6">
            {/* begin::Input */}

            <div className="col-md-4">
              {/* begin::Label */}
              <label className="fw-bold fs-6 mb-2">Trạng thái</label>
