                className={clsx("form-control form-control-solid mb-3 mb-lg-0")}
                autoComplete="off"
                // value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
              />
            </div>
            {/* end::Input */}

            {/* begin::Input */}
            <div className="col-md-8">
              {/* begin::Label */}
              <label className="fw-bold fs-6 mb-2">
                Danh sách dược sĩ liên kết
